import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import { Robots } from './Robots';




ReactDOM.render(
  <React.StrictMode>
    <div>
    <Card id ={robots [0].id} name ={robots [0].name} email={robots[0].emial}/>
    <Card />
    <Card />
    </div>
   </React.StrictMode>,
  document.getElementById('root')
);
